import { createTheme } from "@mui/material";

export const darktheme = createTheme({
  palette: {
    mode: "dark",
    primary: {
      main: "#1a1d23",
    },
    secondary: {
      main: "#e91e63",
    },
    black: {
      main: "#5A20CB",
    },
    background: {
      main: "#000000",
      default: "#0D0D0D",
      paper: "#0D0D0D",
    },
    textColor: "#111111",
  },
});
